import React from 'react'
import './OrderBottom.css'
export default function OrderBottom(props : props) {
    return (
        <div className='containerOrderBottom'>
            <p className='totalMoneyBottomTitle'>Tổng tiền</p>
            <p className='totalMoneyBottom'>{props.toltalNumber}</p>
            <button>Check out</button>
    </div>
    )
}
interface props {
    toltalNumber : number
}
